text:
"giselle" is one of the world's most famous ballets. originating in paris in 1841 - it is the story of a poor young peasant girl with a "weak" heart - giselle - who becomes the wealthy, powerful and perfidious albrecht's lover, only to be discarded by him when he decides to marry a woman from "his class." her "weak" heart breaks. she dies. 
enter the "willlis" - powerful, mystical, female ghosts who yank her out of her grave to help them find and kill albrecht on behalf of all victimized women. having all died of broken hearts themselves, they only exist to seek revenge on men. is this the way? giselle's brain still resides in her heart. she can still  choose to forgive albrecht with her newly muscular and apparently undying heart and does, saving his life and her soul. this ballet is an established part of many classical dance repertoires and is rarely drastically reimagined. akram khan's "giselle the movie" has reimagined it, creating explosive new traditions of dance and filmmaking in the process. his "giselle" is wildly innovative, emotionally riveting, visually stunning and quite the poetic piece of intercultural diffusion (the melding of traditions from one culture and arts genre, to another). i enthusiastically recommend it for a few more reasons - khan has an impressive command of the heart of the story, of the history of dance, of depth psychology (issues of the unconscious and of the heart epistemology linking male/female/shadow story archetypes), of the language of music (vincenzo lamagna's score), of this zeitgeist (#metoo, weinstein et al) and of storytelling in film in general (maxime dos' direction). in this way, his giselle can move entirely new, global audiences, a huge feat for any ballet or dance film. the moral? maybe only reimagine a classic tale if you are bringing something as spectacularly new to the game as mr. khan does here.

